# -*- coding: utf-8 -*-

import requests
import unittest
import json
from test.config import SERV_HOST

__author__ = 'jxh'


# 测试外部彩信接口
class TestMMSInterface(unittest.TestCase):
    def setUp(self):
        pass

    def tearDown(self):
        pass

    # 正常测试流程
    def testNormalCase(self):
        mms_info = {
        "dest_telno": ["18203023453"],
        "title": "test interface",
        "pages":
            [
                {
                    "img": {
                        "type": "jpg",
                        "content": ""
                    },
                    "text": "www.baidu.com"
                }
            ]
        }
        resp = requests.post('http://{}/v1/mmssender'.format(SERV_HOST), data=json.dumps(mms_info))
        self.assertEqual(resp.status_code, 200)

        ret = json.loads(resp.text)
        self.assertEqual(ret["status"], 0)

    # 缺少电话号码列表
    def testLossPhoneList(self):
        mms_info = {
        "title": "test interface",
        "pages":
            [
                {
                    "img": {
                        "type": "jpg",
                        "content": ""
                    },
                    "text": "www.baidu.com"
                }
            ]
        }
        resp = requests.post('http://{}/v1/mmssender'.format(SERV_HOST), data=json.dumps(mms_info))
        self.assertEqual(resp.status_code, 501)

        ret = json.loads(resp.text)
        self.assertEqual(ret["status"], 1000)
